import React from 'react';
import { MDBView, MDBMask} from "mdbreact";


const Graduation = () => {
    return (
        <div>
            <MDBView hover zoom>
                <img
                    src={graduation}
                    className={styles.graduation}
                    alt=""
                />
                <MDBMask className="flex-center">
                    <p>Graduation</p>
                </MDBMask>
            </MDBView>
        </div>
    )
}


const styles = {
    graduation: css`
    height: 100%;
    width: 35%;
    margin-right: 40%;

    `
}
export default Graduation;
